import { Avatar, TextField, Typography } from '@mui/material';
import { Box } from '@mui/system';
import React, {UseState}from 'react';
import NavbarSeller from './navbarSeller';
const MyProfile = () => {
    return ( <>
     <NavbarSeller/>
     <Box sx={{
        position:"absolute",

        width:"100%",
        height:"150px",
        backgroundColor:"lightblue"
     }}>
        <Typography variant="h4" sx={{
            position:"absolute",
            left:"15%",
            top:"60px",
            color:"white",
            alignSelf:"center"
        }}> HARENA.com the leading Ecommerce Website !</Typography>
     </Box>
     <Avatar sx={{
            position:"absolute",
            left:"4%",
            width:"100px",
            top:"110px",
            height:"100px"
        }}></Avatar>
    <Box sx={{
        position:"absolute",
        top:"30%",
        left:"10%",
        width:"80%",
        backgroundColor:"pink",
        height:"60%"

    }}>
        <TextField label="Manager FirstName" sx={{
            marginLeft:"5px"
        }} ></TextField> 
        <TextField label="Manager LastName"sx={{
            marginLeft:"20px"
        }}  ></TextField> 
        <br></br>
        <br></br>
        <TextField label="CompanyName" sx={{
            marginLeft:"20px"
        }} ></TextField> 
        <TextField label="Phone No" sx={{
            marginLeft:"20px"
        }} ></TextField>
        <br></br>
        <br></br>
        <TextField label="Region" sx={{
            marginLeft:"20px"
        }} ></TextField>
        <TextField label="PhoneNumber" sx={{
            marginLeft:"20px"
        }} ></TextField>
        <br></br>
        <br></br>
        <TextField label="City" sx={{
            marginLeft:"20px"
        }} ></TextField>
     
        <TextField label="Stream" sx={{
            marginLeft:"20px"
        }} ></TextField>
    </Box>
    </> 
    );
}

export default MyProfile;
